import axios from 'axios';

const App = () => {
    const [movies, setMovies] = useState([]);

    useEffect(() => {
        const loadMovies = async () => {
            //const response = await axios.get('https://sea-lion-app-vayj4.ondigitalocean.app/api/topics');
            const response = await axios.get('https://localhost:5133/api/movies');
            console.log(response.data.resource);
            setMovies(response.data.resource);
        };

        loadMovies();
    }, []);

    return (
        <>
        {movies.map((movie, i) => (
            <p key={i}>{movie.resource.title} {movie.resource.description}</p>
        ))}
        </>
    )
}

export default App;
